  'AdminAdvparametersHelp' => 
  array (
    'This page benefits from increased performance and includes new features such as a new combination management system.' => 'หน้านี้ได้รับประโยชน์จากประสิทธิภาพที่เพิ่มขึ้นและมีคุณสมบัติใหม่ เช่น ระบบการจัดการชุดค่าผสมใหม่',
    'Access the new product page, even in a multistore context. This is a work in progress and some features are not available.' => 'เข้าถึงหน้าผลิตภัณฑ์ใหม่ แม้ในบริบทของหลายร้านค้า นี่เป็นงานที่อยู่ระหว่างดำเนินการและคุณลักษณะบางอย่างไม่พร้อมใช้งาน',
    'This page benefits from increased performance and includes new features such as a new combination management system. Please note this is a work in progress and some features are not available yet.' => 'หน้านี้ได้รับประโยชน์จากประสิทธิภาพที่เพิ่มขึ้นและมีคุณสมบัติใหม่ เช่น ระบบการจัดการชุดค่าผสมใหม่ โปรดทราบว่านี่เป็นงานที่อยู่ระหว่างดำเนินการและคุณสมบัติบางอย่างยังไม่พร้อมใช้งาน',
    'or' => 'หรือ',
    'Use this option to associate data (products, modules, etc.) the same way for each selected shop.' => 'ใช้ตัวเลือกนี้เพื่อเชื่อมโยงข้อมูล (ผลิตภัณฑ์ โมดูล ฯลฯ) แบบเดียวกันสำหรับแต่ละร้านค้าที่เลือก',
    'Click here to display the shops in the %name% shop group' => 'คลิกที่นี่เพื่อแสดงร้านค้าในกลุ่มร้านค้า %name%',
    'Click here to display the URLs of the %name% shop' => 'คลิกที่นี่เพื่อแสดง URLs ของร้านค้า %name%',
    'Click here to display the list of shop groups' => 'คลิกที่นี่เพื่อแสดงร้านค้าในกลุ่มร้านค้า ',
    'Warning: Enabling the "share customers" and "share orders" options is not recommended. Once activated and orders are created, you will not be able to disable these options. If you need these options, we recommend using several categories rather than several shops.' => 'คำเตือน: ไม่แนะนำให้เปิดใช้ \'แชร์ลูกค้า\' และ \'แชร์คำสั่งซื้อ\' เมื่อเปิดใช้งานและสั่งซื้อแล้วคุณจะไม่สามารถปิดใช้งานตัวเลือกเหล่านี้ได้ หากต้องการตัวเลือกเหล่านี้เราขอแนะนำให้ใช้หมวดหมู่มากกว่าร้านค้าหลายแห่ง',
    'Once this option is enabled, the shops in this group will share customers. If a customer registers in any one of these shops, the account will automatically be available in the others shops of this group.' => 'เมื่อเปิดใช้งานตัวเลือกนี้ร้านค้าในกลุ่มนี้จะแชร์ลูกค้า หากลูกค้าลงทะเบียนในร้านใดร้านหนึ่งบัญชีนี้จะเปิดให้บริการในร้านค้าอื่น ๆ ในกลุ่มนี้โดยอัตโนมัติ',
    'Warning: you will not be able to disable this option once you have registered customers.' => 'คำเตือน: คุณจะไม่สามารถปิดใช้งานตัวเลือกนี้ได้เมื่อคุณลงทะเบียนลูกค้าแล้ว',
    'Once this option is enabled (which is only possible if customers and available quantities are shared among shops), the customer\'s cart will be shared by all shops in this group. This way, any purchase started in one shop will be able to be completed in another shop from the same group.' => 'เมื่อเปิดใช้งานตัวเลือกนี้ (ซึ่งเป็นไปได้ก็ต่อเมื่อมีการแชร์ลูกค้าและจำนวนที่มีระหว่างร้านค้า) รถเข็นของลูกค้าจะถูกแชร์โดยร้านค้าทั้งหมดในกลุ่มนี้ ด้วยวิธีนี้ การซื้อใด ๆ ที่เริ่มต้นในร้านค้าหนึ่งจะสามารถทำเสร็จในร้านค้าอื่นจากกลุ่มเดียวกันได้',
    'Warning: You will not be able to disable this option once you\'ve started to accept orders.' => 'คำเตือน: คุณจะไม่สามารถปิดใช้งานตัวเลือกนี้ได้เมื่อคุณเริ่มรับคำสั่งซื้อแล้ว',
    'Enable or disable this shop group?' => 'เปิดหรือปิดกลุ่มร้านค้านี้?',
    'If you want to add a virtual URL, you need to activate URL rewriting on your web server and enable Friendly URL option.' => 'หากคุณต้องการเพิ่ม URL เสมือน คุณต้องเปิดใช้งานการเขียน URL ใหม่บนเว็บเซิร์ฟเวอร์ของคุณและเปิดใช้งานตัวเลือก URL ที่จำง่าย',
    'You can use this option if you want to create a store with a URL that doesn\'t exist on your server (e.g. if you want your store to be available with the URL www.example.com/my-store/shoes/, you have to set shoes/ in this field, assuming that my-store/ is your Physical URL).' => 'คุณสามารถใช้ตัวเลือกนี้ได้หากต้องการสร้างร้านค้าที่มี URL ที่ไม่มีอยู่ในเซิร์ฟเวอร์ของคุณ (เช่นถ้าคุณต้องการให้ร้านค้าของคุณพร้อมใช้งาน URL www.example.com/my-store/shoes/ คุณ ต้องตั้งรองเท้า / ในฟิลด์นี้โดยสมมติว่า my-store / เป็น Physical URL ของคุณ)',
    'URL rewriting must be activated on your server to use this feature.' => 'URL rewriting ต้องเปิดใช้งานบนเซิร์ฟเวอร์ของคุณเพื่อใช้ฟีเจอร์นี้.',
    'If you set this URL as the Main URL for the selected shop, all URLs set to this shop will be redirected to this URL (you can only have one Main URL per shop).' => 'ถ้าคุณตั้งค่า URL นี้เป็น URL หลัก สำหรับร้านค้าที่เลือกไว้, ทุกๆ URLs ที่ตั้งค่าเพื่อร้านค้านี้จะถูกเปลี่ยนเส้นทางกลับมา URL นี้ด้วย (คุณสามารถมีเพียงหนึ่ง URL ต่อหนึ่งร้านค้าเท่านั้น).',
    'Since the selected shop has no main URL, you have to set this URL as the Main URL.' => 'เนื่องจากร้านค้าที่เลือกไม่มี URL หลักคุณจึงต้องตั้ง URL นี้เป็น URL หลัก',
    'The selected shop already has a Main URL. Therefore, if you set this one as the Main URL, the older Main URL will be set as a regular URL.' => 'ร้านค้าที่เลือกมี URL หลักอยู่แล้ว ดังนั้นหากคุณตั้งค่านี้เป็น URL หลัก URL หลักที่เก่ากว่าจะถูกตั้งเป็น URL ปกติ',
    'This is the physical folder for your store on the web server. Leave this field empty if your store is installed on the root path. For instance, if your store is available at www.example.com/my-store/, you must input my-store/ in this field.' => 'นี่คือโฟลเดอร์จริงสำหรับร้านค้าของคุณบนเว็บเซิร์ฟเวอร์ เว้นช่องนี้ว่างไว้หากร้านค้าของคุณติดตั้งบนเส้นทางราก ตัวอย่างเช่นหากร้านค้าของคุณมีอยู่ที่ www.example.com/my-store/ คุณต้องป้อน my-store / ในช่องนี้',
    'Warning: URL rewriting (e.g. mod_rewrite for Apache) seems to be disabled. If your Virtual URL doesn\'t work, please check with your hosting provider on how to activate URL rewriting.' => 'คำเตือน: ดูเหมือนว่าการเขียน URL ใหม่ (เช่น mod_rewrite สำหรับ Apache) จะถูกปิดใช้งาน หาก URL เสมือนของคุณใช้ไม่ได้โปรดตรวจสอบกับผู้ให้บริการโฮสติ้งของคุณเกี่ยวกับวิธีเปิดใช้งานการเขียน URL ใหม่',
    'Ignore this field if you don\'t use the Multistore tool. If you leave this field empty, the default shop will be used.' => 'ไม่สนใจฟิลด์นี้ถ้าคุณไม่ได้ใช้เครื่องมือหลายร้านค้าและคุณเว้นช่องนี้ว่างร้านเริ่มต้นจะถูกใช้',
    'Enable Advanced Stock Management on product (0 = No, 1 = Yes)' => 'เปิดการใช้งาน Advanced Stock Management บนผลิตภัณฑ์ (0 = ไม่ใช่, 1 = ใช่)',
    'Enable Advanced Stock Management on product (0 = No, 1 = Yes).' => 'เปิดการใช้งาน Advanced Stock Management บนผลิตภัณฑ์ (0 = ไม่ใช่, 1 = ใช่)',
    'This will add directives to your .htaccess file, which should improve caching and compression.' => 'การดำเนินการนี้จะเพิ่มคำสั่งให้กับไฟล์ .htaccess ของคุณ ซึ่งควรปรับปรุงการแคชและการบีบอัด',
    'Enable or disable debug mode.' => 'เปิดใช้งาน หรือ ปิดใช้งาน debug mode.',
