    'Name of the third domain of your shop, (e.g. myshop-media-server-2.com). If you do not have another domain, leave this field blank.' => 'ชื่อโดเมนที่สามของร้านค้าของคุณ (เช่น myshop-media-server-2.com) หากคุณไม่มีโดเมนอื่น ให้เว้นฟิลด์นี้ว่างไว้',
    'Name of the fourth domain of your shop, (e.g. myshop-media-server-3.com). If you do not have another domain, leave this field blank.' => 'ชื่อโดเมนที่สองของร้านค้าของคุณ (เช่น myshop-media-server-3.com) หากคุณไม่มีโดเมนอื่นให้ปล่อยฟิลด์นี้ให้ว่างไว้',
