    'Choose a stability level for the modules downloaded from PrestaShop Addons Marketplace. All zips pushed on the marketplace are in stable state unless stated otherwise.' => 'เลือกระดับความเสถียรสำหรับโมดูลที่ดาวน์โหลดจาก PrestaShop Addons Marketplace Zipทั้งหมดที่ส่งเข้ามาไว้ในตลาดจะอยู่ในสถานะเสถียร เว้นแต่จะระบุไว้เป็นอย่างอื่น',
    'Check the IP address of the cookie in order to prevent your cookie from being stolen.' => 'ตรวจสอบเลขไอพีเครื่องจากคุ๊กกี้เพื่อปกป้องคุ้กกี้ของคุณจากการถูกขโมยข้อมูล',
    'Set the amount of hours during which the front office cookies are valid. After that amount of time, the customer will have to log in again.' => 'กำหนดจำนวนชั่วโมงที่คุกกี้ของแผนกต้อนรับใช้ได้ หลังจากนั้นลูกค้าจะต้องเข้าสู่ระบบอีกครั้ง',
    'When you access your back office and decide to stay logged in, your cookies lifetime defines your browser session. Set here the number of hours during which you want them valid before logging in again.' => 'เมื่อคุณเข้าถึง back office ของคุณและตัดสินใจที่จะอยู่ในระบบต่อไป อายุการใช้งานคุกกี้ของคุณจะกำหนดเซสชันเบราว์เซอร์ของคุณ ตั้งค่าที่นี่เป็นจำนวนชั่วโมงที่คุณต้องการให้ใช้งานได้ก่อนที่จะเข้าสู่ระบบอีกครั้ง',
    'Allows you to declare if your cookie should be restricted to a first-party or same-site context.' => 'อนุญาตให้คุณประกาศว่าควรจำกัดคุกกี้ของคุณให้อยู่ในบริบทของบุคคลที่หนึ่งหรือเว็บไซต์เดียวกันหรือไม่',
    'Set the maximum size allowed for attachment files (in megabytes). This value has to be lower than or equal to the maximum file upload allotted by your server (currently: %size% MB).' => 'กำหนดขนาดสูงสุดที่อนุญาตสำหรับไฟล์แนบ (เป็นเมกะไบต์) ค่านี้ต้องต่ำกว่าหรือเท่ากับการอัปโหลดไฟล์สูงสุดที่เซิร์ฟเวอร์ของคุณกำหนด (ปัจจุบันคือ %size% MB)',
    'Define the upload limit for a downloadable product (in megabytes). This value has to be lower or equal to the maximum file upload allotted by your server (currently: %size% MB).' => 'กำหนดขีดจำกัดการอัปโหลดสำหรับผลิตภัณฑ์ที่ดาวน์โหลดได้ (เป็นเมกะไบต์) ค่านี้ต้องต่ำกว่าหรือเท่ากับจำนวนไฟล์สูงสุดที่เซิร์ฟเวอร์ของคุณกำหนด (ปัจจุบันคือ %size% MB)',
    'Define the upload limit for an image (in megabytes). This value has to be lower or equal to the maximum file upload allotted by your server (currently: %size% MB).' => 'กำหนดขีดจำกัดการอัปโหลดสำหรับรูปภาพ (เป็นเมกะไบต์) ค่านี้ต้องต่ำกว่าหรือเท่ากับจำนวนไฟล์สูงสุดที่เซิร์ฟเวอร์ของคุณกำหนด (ปัจจุบันคือ %size% MB)',
    'Drop existing tables during import.' => 'ลบตารางที่มีอยู่ในระหว่างการนำเข้า',
    'If enabled, the backup script will drop your tables prior to restoring data. (ie. "DROP TABLE IF EXISTS")' => 'หากเปิดใช้งาน สคริปต์สำรองข้อมูลจะทิ้งตารางของคุณก่อนที่จะกู้คืนข้อมูล (เช่น ""DROP TABLE IF EXISTS")',
    'A DKIM selector usually looks like 12345.domain. It must match the name of your DNS record.' => 'ตัวเลือก DKIM มักจะดูเหมือน 12345.domain ต้องตรงกับชื่อระเบียน DNS ของคุณ',
    'The private key starts with -----BEGIN RSA PRIVATE KEY-----.' => 'private คีย์ เริ่มต้นด้วย -----BEGIN RSA PRIVATE KEY-----.',
    'Where customers send messages from the order page.' => 'ข้อความที่ลูกค้าส่งจากหน้าสั่งซื้อ.',
    'Enable DKIM, fill in the fields and give it a try. If no email is sent, check logs.' => 'เปิดใช้งาน DKIM กรอกข้อมูลในฟิลด์และลองทำดู หากไม่มีการส่งอีเมล ให้ตรวจสอบบันทึก',
    'Fully qualified domain name (keep this field empty if you don\'t know).' => 'ชื่อโดเมนแบบเต็ม (เว้นช่องนี้ว่างไว้หากคุณไม่ทราบ)',
    'IP address or server name (e.g. smtp.mydomain.com).' => 'หมายเลขไอพีเครื่อง หรือ ชื่อเซิร์ฟเวอร์ (เช่น smtp.mydomain.com).',
    'Leave blank if not applicable.' => 'ปล่อยว่างถ้าไม่ต้องการเปลี่ยน.',
    'SSL does not seem to be available on your server.' => 'SSL ดูเหมือนจะไม่พร้อมใช้งานบนเซิร์ฟเวอร์ของคุณ',
