    'e.g. 1; Blouse; 129.90; 5' => 'เช่น. 1; Blouse; 129.90; 5',
    'e.g. Blouse; red.jpg, blue.jpg, green.jpg; 129.90 ' => 'เช่น Blouse; red.jpg, blue.jpg, green.jpg; 129.90 ',
    'If enabled, the product\'s reference number MUST be unique!' => 'หากเปิดใช้งานหมายเลขอ้างอิงของผลิตภัณฑ์จะต้องไม่ซ้ำกัน!',
    'Enable this option to keep your imported items’ ID number as is. Otherwise, PrestaShop will ignore them and create auto-incremented ID numbers.' => 'เปิดใช้งานตัวเลือกนี้เพื่อรักษาหมายเลขประจำตัวของสินค้าที่นำเข้าของคุณตามที่เป็นอยู่ มิฉะนั้น PrestaShop จะเพิกเฉยและสร้างหมายเลข ID ที่เพิ่มขึ้นโดยอัตโนมัติ',
    'Receive an email when the import is complete. It can be useful when handling large files, as the import may take some time.' => 'รับอีเมลเมื่อการนำเข้าเสร็จสมบูรณ์ ซึ่งจะมีประโยชน์ในการจัดการไฟล์ขนาดใหญ่ เนื่องจากการนำเข้าอาจใช้เวลาสักครู่',
    'Click on "None" to disable log alerts by email or enter the recipients of these emails in the following field.' => 'คลิกที่ "ไม่มี" เพื่อปิดใช้งานการแจ้งเตือนบันทึกทางอีเมล หรือป้อนผู้รับของอีเมลเหล่านี้ในฟิลด์ต่อไปนี้',
    'Log alerts will be sent to these emails. Please use a comma to separate them (e.g. pub@prestashop.com, anonymous@psgdpr.com).' => 'คลิก "ไม่มี" เพื่อปิดการใช้งานช่วยเตือนบันทึกทางอีเมลหรือป้อนผู้รับของอีเมลเหล่านี้ในส่วนที่เหลือต่อไปนี้',
    'Back office pages require the use of a token. This protection can be disabled if needed.' => 'หน้า Back Office จำเป็นต้องใช้โทเค็น การป้องกันนี้สามารถปิดใช้งานได้หากจำเป็น',
    'Before activating the webservice, you must be sure to: ' => 'ก่อนเปิดใช้งานบริการเว็บ คุณต้องแน่ใจว่าได้:',
    'Check that URL rewriting is available on this server.' => 'กรุณาตรวจสอบว่า URL rewriting พร้อมใช้งานบนเซิร์ฟเวอร์นี้.',
    'Check that the six methods GET, POST, PUT, PATCH, DELETE and HEAD are supported by this server.' => 'ตรวจสอบว่าเซิร์ฟเวอร์นี้รองรับหกวิธี GET, POST, PUT, PATCH, DELETE และ HEAD',
    'Before choosing "Yes", check that PHP is not configured as an Apache module on your server.' => 'ก่อนเลือกตัวเลือก "ใช่", กรุณาตรวจสอบว่า PHP นั้นไม่ถูกปรับแต่งเป็นโมดูลของ Apache บนเซิร์ฟเวอณ์ของคุณ',
    'Quick description of the key: who it is for, what permissions it has, etc.' => 'คำอธิบายโดยย่อของคีย์: สำหรับใครมีสิทธิ์อะไร ฯลฯ',
    'Password should be at least %num% characters long.' => 'รหัสผ่านจะต้องมีความยาวอย่างน้อย %num% ตัวอักษร',
    'How to restore a database backup in 10 easy steps' => 'วิธีคืนค่าการสำรองฐานข้อมูลใน 10 ขั้นตอนง่ายๆ',
    'Set "Enable Shop" to "No" in the "Maintenance" page under the "Preferences" menu.' => 'ตั้งค่า "เปิดใช้งานร้านค้า" เป็น "ไม่" ในหน้า "การบำรุงรักษา" ใต้เมนู "การตั้งค่า"',
    'Download the backup from the list below or from your FTP server (in the folder "admin/backups").' => 'ดาวน์โหลดสำรองจากรายการด้านล่างหรือจากเซิร์ฟเวอร์ FTP ของคุณ (ในโฟลเดอร์"ผู้ดูแลระบบ / การสำรองข้อมูล")',
    'Check the backup integrity: Look for errors, incomplete file, etc... Be sure to verify all of your data.' => 'ตรวจสอบความสมบูรณ์ของการสำรองข้อมูล : มองหาข้อผิดพลาดที่ไฟล์ไม่สมบูรณ์ ตรวจสอบข้อมูลทั้งหมดของคุณ',
    'Please ask your hosting provider for "phpMyAdmin" access to your database.' => 'ถามผู้ให้บริการโฮสติ้งของคุณสำหรับ&quot;phpMyAdmin&quot;การเข้าถึงฐานข้อมูลของคุณ',
