    'Unless you enabled the "Drop existing tables" option, you must delete all tables from your current database.' => 'เว้นแต่คุณจะเปิดใช้งาน"เลื่อนตารางที่มีอยู่"ตัวเลือกที่คุณต้องลบตารางทั้งหมดจากฐานข้อมูลปัจจุบันของคุณ',
    'At the top of the screen, please select the "Import" tab' => 'ที่ส่วนด้านบนสุดของหน้าจอ, กรุณาเลือกแท็บ "นำเข้า"',
    'Click on the "%phpmyadmin_browse_label%" button and select the backup file from your hard drive.' => 'คลิกที่ปุ่ม "%phpmyadmin_browse_label%" และเลือกไฟล์สำรองข้อมูลจากฮาร์ดไดรฟ์ของคุณ',
    'Check the maximum filesize allowed (e.g. Max: 16MB)' => 'ตรวจสอบขนาดไฟล์สูงสุดที่อนุญาต (เช่น สูงสุด: 16MB)',
    'If your backup file exceeds this limit, contact your hosting provider for assistance. ' => 'หากไฟล์สำรองของคุณเกินขีดจำกัดนี้ โปรดติดต่อผู้ให้บริการโฮสติ้งเพื่อขอความช่วยเหลือ',
    'Click on the "%phpmyadmin_go_label%" button and please wait patiently for the import process to conclude. This may take several minutes.' => 'คลิกที่ปุ่ม "%phpmyadmin_go_label%" และโปรดรออย่างอดทนเพื่อให้กระบวนการนำเข้าเสร็จสิ้น นี้อาจใช้เวลาหลายนาที.',
    'You can read information on import at:' => 'คุณสามารถอ่านข้อมูลเกี่ยวกับการนำเข้าได้ที่:',
    'https://docs.prestashop-project.org/1.7-documentation/user-guide/configuring-shop/advanced-parameters/import' => 'https://docs.prestashop-project.org/1.7-documentation/user-guide/configuring-shop/advanced-parameters/import',
    'Read more about the CSV format at:' => 'อ่านข้อมูลเพิ่มเติมเกี่ยวกับรูปแบบไฟล์ CSV ได้ที่',
    'https://en.wikipedia.org/wiki/Comma-separated_values' => 'https://en.wikipedia.org/wiki/Comma-separated_values',
    'Allowed formats: .csv, .xls, .xlsx, .xlst, .ods, .ots' => 'รูปแบบที่อนุญาต: .csv, .xls, .xlsx, .xlst, .ods, .ots',
    'Only UTF-8 and ISO 8859-1 encodings are allowed' => 'อนุญาตให้ใช้การเข้ารหัส UTF-8 และ ISO 8859-1 เท่านั้น',
    'You can also upload your file via FTP to the following directory: %s .' => 'คุณสามารถอัพโหลดไฟล์ของคุณผ่านทาง FTP ไปไว้ที่ไดเร็กทอรี่ต่อไปนี้ได้:  %s ',
    'Fill in the fields below to set up DKIM signing of outgoing emails. This will reduce the likelihood of your emails being marked as spam.
              You can get the data below from your server administrator or generate it yourself by using one of the freely available tools, such as dkimcore.org.
              Also, make sure that your server is registered as an authorized sender in your SPF record. ' => 'กรอกข้อมูลในช่องด้านล่างเพื่อตั้งค่าการเซ็นชื่อ DKIM ของอีเมลขาออก วิธีนี้จะลดโอกาสที่อีเมลของคุณจะถูกทำเครื่องหมายว่าเป็นสแปม
