    'All outdated sessions will be automatically cleared after the first connection attempt, but you can do it manually now if needed.' => 'เซสชันที่ล้าสมัยทั้งหมดจะถูกล้างโดยอัตโนมัติหลังจากพยายามเชื่อมต่อครั้งแรก แต่คุณสามารถทำได้ด้วยตนเองตอนนี้หากจำเป็น',
