    'This feature allows you to identify modules that might be causing bugs on your store. Disable all non-built-in modules (not listed in composer.json). Then, re-enable each module one by one and check that everything works properly before moving on to the next one.' => 'คุณสมบัตินี้ช่วยให้คุณระบุโมดูลที่อาจก่อให้เกิดข้อบกพร่องในร้านค้าของคุณ ปิดการใช้งานโมดูลที่ไม่ได้สร้างมาทั้งหมด (ไม่ได้อยู่ในรายการ Composer.json) จากนั้น เปิดใช้งานแต่ละโมดูลอีกครั้งทีละรายการ และตรวจสอบว่าทุกอย่างทำงานได้อย่างถูกต้องก่อนที่จะดำเนินการต่อไปยังโมดูลถัดไป',
    'Some features can be disabled in order to improve performance.' => 'คุณลักษณะบางอย่างสามารถปิดใช้งานได้เพื่อปรับปรุงประสิทธิภาพ',
    'CCC allows you to reduce the loading time of your page. With these settings you will gain performance without even touching the code of your theme. Make sure, however, that your theme is compatible with PrestaShop 1.7+. Otherwise, CCC will cause problems.' => 'CCC ช่วยให้คุณสามารถลดเวลาในการโหลดหน้าเว็บของคุณ ด้วยการตั้งค่าเหล่านี้คุณจะได้รับประสิทธิภาพการทำงานได้โดยไม่ต้องสัมผัสรหัสของชุดรูปแบบของคุณ ตรวจสอบให้แน่ใจ แต่ที่ธีมของคุณสามารถทำงานร่วมกับ PrestaShop 1.7 + มิฉะนั้น, CCC จะทำให้เกิดปัญหา',
